        // GET: Service
        MobileAppBLL mobileAppBLL = new MobileAppBLL();

        [HttpPost]
        public ActionResult Login(LoginCredential loginCredential)
        {

            var loginResponse = mobileAppBLL.ValidateUser(loginCredential);
            return Json(loginResponse, JsonRequestBehavior.AllowGet);
        }

