        public ActionResult GetPlant()
        {


            var plants = mobileAppBLL.GetPlant();
            return Json(plants, JsonRequestBehavior.AllowGet);
        }
        public ActionResult GetCAPAPlant()
        {


            var capaplants = mobileAppBLL.GetcapaPlants();
            return Json(capaplants, JsonRequestBehavior.AllowGet);
        }

        public ActionResult GetClassification()
        {

            var Classification = mobileAppBLL.GetIncidentClassfication();
            return Json(Classification, JsonRequestBehavior.AllowGet);
        }
        public ActionResult GetAuditType()
        {
            var AuditType = mobileAppBLL.GetAuditType();
            return Json(AuditType, JsonRequestBehavior.AllowGet);
        }

       
        public ActionResult GetCAPAObservation(int CAPAID)
        {
            var CAPAOb = mobileAppBLL.GetAPAObservation(CAPAID);
            return Json(CAPAOb, JsonRequestBehavior.AllowGet);
        }
       

        [AcceptVerbs(HttpVerbs.Get)]
        public JsonResult GetAuditCAPAsource(int AuditID)
        {

            var cs = mobileAppBLL.GetAuditCAPAsource(AuditID).Select(m => new SelectListItem()
            {
                Value = m.AuditCSID.ToString(),
                Text = m.Name
            });
            return Json(cs, JsonRequestBehavior.AllowGet);
        }

        public ActionResult GetContractorEMP()
        {

            var ContractorEMP = mobileAppBLL.GetContractorEmp();
            return Json(ContractorEMP, JsonRequestBehavior.AllowGet);
        }
