        public string IncidentBase64ToImage(string imgst)
        {


            string concat = imgst.Replace("data:image/png;base64,", "");
            byte[] imageBytes = Convert.FromBase64String(concat);
            MemoryStream ms = new MemoryStream(imageBytes, 0, imageBytes.Length);
            // Convert byte[] to Image
            ms.Write(imageBytes, 0, imageBytes.Length);
            System.Drawing.Image image = System.Drawing.Image.FromStream(ms, true);
            //save image
            string temp = Guid.NewGuid().ToString() + ".png";
            image.Save(Server.MapPath("~/IncidentAttachments/" + temp), ImageFormat.Png);

            return temp;
        }
        [HttpPost]
        public ActionResult CreateCAPA(CAPAinsert cinsert)
        {

            var CAPAID = mobileAppBLL.CAPAInsertUpdate(cinsert);
            return Json(CAPAID, JsonRequestBehavior.AllowGet);
        }

