        public string WorkpermitAttachBase64ToImage(string img)
        {

            string concat = img.Replace("data:image/png;base64,", "");
            byte[] imageBytes = Convert.FromBase64String(concat);
            MemoryStream ms = new MemoryStream(imageBytes, 0, imageBytes.Length);
            // Convert byte[] to Image
            ms.Write(imageBytes, 0, imageBytes.Length);
            System.Drawing.Image image = System.Drawing.Image.FromStream(ms, true);
            //save image
            string temp = Guid.NewGuid().ToString() + ".png";
            image.Save(Server.MapPath("~/ClosedPermitAttachment/" + temp), ImageFormat.Png);

            return temp;
        }
